            Learn React
            </a>



            <div id="over" style=" justify-content: center; display: flex; align-items: center"></div>
            <div> <img src="assets/festival-vilar-de-mouros-bg.jpg" width="100%" alt=""> </img> </div>
            <div style="position: absolute; display: flex;"> <img src="assets/logo-datas-2025.png" alt=""> </img> </div>
        </div>
    );
}

export default Header;
